    }
    const updateCity=(e)=>{
        setSearch(previousData=>{
            return{...previousData,city:(e.target.value)}
        })
    }
    const updateCountry=(e)=>{
        setSearch(previousData=>{
            return{...previousData,country:(e.target.value)}
        })
    }
    const updateContinent=(e)=>{
        setSearch(previousData=>{
